// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/// @title SnatchVeggiesBank
/// @notice Contratos de SnatchVeggiesBank

contract SnatchVeggiesBank {
  /*************
   * Variables *
   *************/

  bool public paused;
  uint256 public fee;

  address payable public owner;
  address payable public messenger;

  mapping(address => uint256) public allowances;

  /**********
   * Events *
   **********/

  event Paused();
  event Unpaused();

  event Approval(address indexed approver, uint256 amount);
  event Take(address indexed from, address indexed to, uint256 amount);

  /***************
   * Constructor *
   ***************/

  constructor() {
    owner = payable(msg.sender);
    messenger = payable(msg.sender);
    paused = false;
    fee = 0.0015 ether;
  }

  /**********************
   * Function Modifiers *
   **********************/

  modifier onlyOwner() {
    require(msg.sender == owner, "SnatchVeggiesBank: Caller is not the owner");
    _;
  }

  modifier whenNotPaused() {
    require(!paused, "SnatchVeggiesBank: Contract is paused");
    _;
  }

  modifier onlyMessenger() {
    require(msg.sender == messenger, "SnatchVeggiesBank: Caller is not the messenger");
    _;
  }

  /*******************
   * Utils Functions *
   *******************/

  receive() external payable {}

  /// @notice Pauses the contract.

  function pause() external onlyOwner {
    paused = true;
    emit Paused();
  }

  /// @notice Unpauses the contract.

  function unpause() external onlyOwner {
    paused = false;
    emit Unpaused();
  }

  /**********************
   * Settings Functions *
   **********************/

  /// @notice Changes the contract owner.
  /// @param _fee Fee amount.

  function changeFee(uint256 _fee) external onlyOwner {
    fee = _fee;
  }

  /// @notice Changes the contract owner.
  /// @param _newOwner Address of the new owner.

  function changeOwner(address _newOwner) external onlyOwner {
    require(_newOwner != address(0), "SnatchVeggiesBank: New owner is the zero address");
    owner = payable(_newOwner);
  }

  /// @notice Changes the contract messenger.
  /// @param _newMessenger Address of the new messenger.

  function changeMessenger(address _newMessenger) external onlyOwner {
    require(_newMessenger != address(0), "SnatchVeggiesBank: New messenger is the zero address");
    messenger = payable(_newMessenger);
  }

  /**********************
   * Handlers Functions *
   **********************/

  /// @notice Returns the ETH balance of the contract.
  /// @return The ETH balance of the contract.

  function balanceETH() external view returns (uint256) {
    return address(this).balance;
  }

  /// @notice Transfers ETH from the contract to a specified address.
  /// @param _to Address to receive the ETH.
  /// @param _amount Amount of ETH to transfer.

  function transferETH(address _to, uint256 _amount) external onlyOwner {
    require(_to != address(0), "SnatchVeggiesBank: Transfer to the zero address");
    require(_amount <= address(this).balance, "SnatchVeggiesBank: Insufficient contract balance");
    payable(_to).transfer(_amount);
  }

  /**********************
   * External Functions *
   **********************/

  /// @notice Approves a certain amount of ETH for the messenger.

  function approve() external payable whenNotPaused {
    require(msg.value >= fee, "SnatchVeggiesBank: The approval value must be higher");
    allowances[msg.sender] += msg.value;
    emit Approval(msg.sender, msg.value);
  }

  /// @notice Executes a sale transaction by transferring ETH to the messenger.
  /// @param _from Address of the seller.
  /// @param _amount Amount of ETH to transfer.

  function take(address _from, uint256 _amount) external payable onlyMessenger {
    require(allowances[_from] >= _amount, "SnatchVeggiesBank: Insufficient allowance");
    require(_amount > fee, "SnatchVeggiesBank: Take amount must be greater");

    allowances[_from] -= _amount;
    payable(messenger).transfer(_amount);

    emit Take(_from, messenger, _amount);
  }
}

